import { View, Text } from 'react-native'
import React from 'react'
import { TouchableOpacity } from 'react-native-web';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons'

export default function RestaurantItem() {
  return (
    <View>
      {/* Restaurant Image */}
      {/*  Restaurant Info */}
    </View>
  )
}


const RestaurantImage = () => (
  <>
      <Image
      // source = {{
      //       URL : "https://images.pexels.com/photos/67468/pexels-photo-67468.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
      // }}
	   source = {require('../assets/images/rest.jpg')} 
      style ={{ width : "100%" , height : 180}}
      />
      <TouchableOpacity style={{position : "absolute", right : 40, top : 20}}>
      <MaterialCommunityIcons name="heart-outline" size={25} color="white"/>
      </TouchableOpacity>
      </>
);
